import React from 'react'

const GetUser = () => {

  const getdetails = async () =>
    {
      const response = await fetch("http://localhost:2000/api/auth/getuser", {
      method: 'POST',
      headers: {
            'auth-token' : localStorage.getItem('token')
            },
         });
         const json = await response.json()
         if (json.success) 
          {
            console.log(json);
          }
          else
          {
            console.log("invalid");
          }
    }
  return (
    <div>
      getdetails();
    </div>
  )
}

export default GetUser
